text:
Adversarial stylometry

{{short description|Textual anonymisation techniques}}
{{Use British English|date=February 2023}}
{{Use dmy dates|date=February 2023}}

'''Adversarial stylometry''' is the practice of altering writing style to reduce the potential for [[stylometry]] to discover the author's identity or their characteristics. This task is also known as '''authorship obfuscation''' or '''authorship anonymisation'''. Stylometry poses a significant [[privacy]] challenge in its ability to unmask [[anonymity|anonymous]] authors or to link [[pseudonym]]s to an author's other identities, which, for example, creates difficulties for [[whistleblowers]], activists, and [[hoax]]ers and [[fraud]]sters. The privacy risk is expected to grow as [[machine learning]] techniques and [[text corpora]] develop.

All adversarial stylometry shares the core idea of faithfully [[paraphrasing (computational linguistics)|paraphrasing]] the source text so that the meaning is unchanged but the stylistic signals are obscured. Such a faithful paraphrase is an [[adversarial example]] for a stylometric classifier. Several broad approaches to this exist, with some overlap: ''imitation'', substituting the author's own style for another's; ''translation'', applying [[machine translation]] with the hope that this eliminates characteristic style in the source text; and ''obfuscation'', deliberately modifying a text's style to make it not resemble the author's own.

Manually obscuring style is possible, but laborious; in some circumstances, it is preferable or necessary. Automated tooling, either semi- or fully-automatic, could assist an author. How best to perform the task and the design of such tools is an open research question. While some approaches have been shown to be able to defeat particular stylometric analyses, particularly those that do not account for the potential of adversariality, establishing safety in the face of unknown analyses is an issue. Ensuring the faithfulness of the paraphrase is a critical challenge for automated tools.

It is uncertain if the practice of adversarial stylometry is detectable in itself. Some studies have found that particular methods produced signals in the output text, but a stylometrist who is uncertain of what methods may have been used may not be able to reliably detect them.

Adversarial stylometry

== History ==

{{harvtxt|Rao|Rohatgi|2000}}, an early work in adversarial stylometry,{{sfn|Brennan|Afroz|Greenstadt|2012|p=3-4}} identified machine translation as a possibility, but noted that the quality of translators available at the time presented severe challenges.{{sfn|Kacmarcik|Gamon|2006|p=445}} {{harvtxt|Kacmarcik|Gamon|2006}} is another early work. {{harvtxt|Brennan|Afroz|Greenstadt|2012}} performed the first evaluation of adversarial stylometric methods on actual texts.{{sfn|Brennan|Afroz|Greenstadt|2012|p=3-4}}

{{harvtxt|Brennan|Greenstadt|2009}} introduced the first corpus of adversarially authored texts specifically for evaluating stylometric methods;{{sfn|Juola|Vescovi|2011|p=117}} other corpora include the [[International Imitation Hemingway Competition]], the [[Faux Faulkner contest]], and the hoax blog ''[[A Gay Girl in Damascus]]''.{{sfn|Afroz|Brennan|Greenstadt|2012|p=466}}

Adversarial stylometry

== Motivations ==

{{harvtxt|Rao|Rohatgi|2000}} suggest that short, unattributed documents (i.e., [[anonymous post]]s) are not at risk of stylometric identification, but [[pseudonymous]] authors who have not practiced adversarial stylometry in producing corpuses of thousands of words may be vulnerable.{{sfn|Rao|Rohatgi|2000|loc=1.3 Contributions}} {{harvtxt|Narayanan|Paskov|Gong|Bethencourt|2012}} attempted large-scale deanonymisation of 100,000 blog authors with mixed results: the identifications were significantly better than chance, but only accurately matched the blog and author a fifth of the time;{{sfn|Grndahl|Asokan|2020a|p=19}} identification improved with the number of posts written by the author in the corpus.{{sfn|Narayanan|Paskov|Gong|Bethencourt|2012|p=301}} Even if an author is not identified, some of their characteristics may still be deduced stylometrically,{{sfn|Emmery|Kdr|Chrupaa|2021|p=2388}} or stylometry may narrow the [[anonymity set]] of potential authors sufficiently for other information to complete the identification.{{sfn|Narayanan|Paskov|Gong|Bethencourt|2012|p=301}} Detecting author characteristics (e.g., gender or age) is often simpler than identifying an author from a large, possibly open, set of candidates.{{sfn|Shetty|Schiele|Fritz|2018|loc=1 Introduction}}

Modern [[machine learning]] techniques offer powerful tools for identification;{{sfn|Mahmood|Ahmad|Shafiq|Srinivasan|2019|p=54}} further development of corpora and computational stylometric techniques are likely to raise further privacy issues.{{sfn|Grndahl|Asokan|2020a|p=28}} {{harvtxt|Grndahl|Asokan|2020a}} say that the general validity of the hypothesis underlying stylometry&mdash;that authors have invariant, content-independent 'style fingerprints'&mdash;is uncertain, but "the deanonymisation attack is a real privacy concern".{{sfn|Grndahl|Asokan|2020a|p=3}}

Those interested in practicing adversarial stylometry and stylistic deception include [[whistleblowers]] avoiding retribution;{{sfn|Kacmarcik|Gamon|2006|p=444}} journalists and activists;{{sfn|Mahmood|Ahmad|Shafiq|Srinivasan|2019|p=54}} perpetrators of [[fraud]]s and [[hoax]]es;{{sfn|Afroz|Brennan|Greenstadt|2012|p=461}} authors of [[fake reviews]];{{sfn|Grndahl|Asokan|2020a|p=4}} [[literary forgery|literary forgers]];{{sfn|Potthast|Hagen|Stein|2016|p=5}} criminals disguising their identity from investigators;{{sfn|Juola|Vescovi|2011|p=115}} and, generally, anyone with a desire for [[anonymity]] or pseudonymity.{{sfn|Kacmarcik|Gamon|2006|p=444}} Authors, or agents acting on behalf of authors, may also attempt to remove stylistic clues to author characteristics (e.g., race or gender) so that knowledge of those characteristics cannot be used for discrimination (e.g., through [[algorithmic bias]]).{{sfn|Xu|Qu|Xu|Cui|2019|p=247}}{{sfn|Mireshghallah|Berg-Kirkpatrick|2021|p=2009}} Another possible use for adversarial stylometry is in disguising [[text generation|automatically generated text]] as human-authored.{{sfn|Uchendu|Le|Lee|2022|p=1}}

Adversarial stylometry

== Methods ==

With imitation, the author attempts to mislead stylometry by matching their style to another author's.{{sfn|Neal|Sundararajan|Fatima|Yan|2018|p=6}} An incomplete imitation, where some of the true author's unique characteristics appear alongside the imitated author's, can be a detectable signal for the use of adversarial stylometry.{{sfn|Kacmarcik|Gamon|2006|p=446}} Imitation can be performed automatically with [[style transfer]] systems, though this typically requires a large corpus in the target style for the system to learn from.{{sfn|Wang|Juola|Riddell|2022|p=2}}

Another approach is translation, which employs [[machine translation]] of a source text to eliminate characteristic style, often through multiple translators in sequence to produce a [[round-trip translation]]. Such chained translation can lead to texts being significantly altered, even to the point of incomprehensibility; improved translation tools reduce this risk. More simply-structured texts can be easier to machine translate without losing the original meaning.{{sfn|Neal|Sundararajan|Fatima|Yan|2018|p=6}} Machine translation blurs into direct stylistic imitation or obfuscation achieved through automated style transfer, which can be viewed as a "translation" with the same language as input and output.{{sfn|Shetty|Schiele|Fritz|2018|loc=2 Related Work}}{{sfn|Adelani|Zhang|Shen|Davody|2021|p=8687}} With low-quality translation tools, an author can be required to manually correct major translation errors while avoiding the hazard of re-introducing stylistic characteristics.{{sfn|Kacmarcik|Gamon|2006|p=445}} {{harvtxt|Wang|Juola|Riddell|2022}} found that gross errors introduced by [[Google Translate]] were rare, but more common with several intermediate translations&mdash;however, occasional simple or short sentences and misspellings in the source text appeared verbatim in the output, potentially providing an identifying signal.{{sfn|Wang|Juola|Riddell|2022|p=8}} Chain translation can leave characteristic traces of its application in a document, which may allow reconstruction of the intermediate languages used and the number of translation steps performed.{{sfn|Wang|Juola|Riddell|2022|p=2}}

Obfuscation involves deliberately changing the style of a text to reduce its similarity to other texts by some metric; this may be performed at the time of writing by conscious modification, or as part of a revision process with feedback from the metric being targeted as an input to decide when the text has been sufficiently obfuscated. In contrast to translation, complex texts can offer more opportunities for effective obfuscation without altering meaning,{{sfn|Neal|Sundararajan|Fatima|Yan|2018|p=6-7}} and likewise genres with more permissible variation allow more obfuscation.{{sfn|Neal|Sundararajan|Fatima|Yan|2018|p=26}} However, longer texts are harder to thoroughly obfuscate.{{sfn|Mahmood|Ahmad|Shafiq|Srinivasan|2019|p=55}} Obfuscation can blend into imitation if the author develops a novel target style, distinct from their original style.{{sfn|Afroz|Brennan|Greenstadt|2012|p=471}} With respect to masking author characteristics, obfuscation may aim to achieve a union (adding signals for imitated characteristics) or an intersection (removing signals and normalising) of other authors' styles.{{sfn|Mireshghallah|Berg-Kirkpatrick|2021|p=2009-2010}} Avoiding the author's own idiosyncrasies and producing a "normalised" text is a critical obfuscatory step: an author may have a unique tendency to misspell certain words, use particular variants, or to format a document in a characteristic way.{{sfn|Kacmarcik|Gamon|2006|p=445}}{{sfn|Rao|Rohatgi|2000|loc=5 Future Directions}} Stylometric signals vary in how simply they can be adversarially masked; an author may easily change their vocabulary by conscious choice, but altering the pattern of grammar or the [[letter frequency]] in their text may be harder to achieve, though {{harvtxt|Juola|Vescovi|2011}} report that imitation typically succeeds at masking more characteristics than obfuscation.{{sfn|Juola|Vescovi|2011|p=121-123}} Automated obfuscation may require large amounts of training data written by the author.{{sfn|Mahmood|Ahmad|Shafiq|Srinivasan|2019|p=55}}

Concerning automated implementations of adversarial stylometry, two possible implementations are [[rule-based system]]s for paraphrasing; and encoder&ndash;decoder architectures, where the text passes through an intermediate format that is (intended to be) style-neutral.{{sfn|Grndahl|Asokan|2020b|p=177}} Another division in automated methods is whether there is feedback from an identification system or not.{{sfn|Haroon|Zaffar|Srinivasan|Shafiq|2021|p=1}} With such feedback, finding paraphrases for author masking has been characterised as a [[heuristic (computer science)|heuristic]] [[search problem]], exploring textual variants until the result is stylistically sufficiently far (in the case of obfuscation) or near (in the case of imitation), which then constitutes an [[adversarial example]] for that identification system.{{sfn|Bevendorff|Potthast|Hagen|Stein|2019|p=1098}}{{sfn|Saedi|Dras|2020|p=181}}

Adversarial stylometry

== Evaluation ==

How to best mask stylometric characteristics in practice, and what tasks to perform manually, what with tool assistance, and what fully automatically, is an open field of research, especially in short documents with limited potential variability.{{sfn|Neal|Sundararajan|Fatima|Yan|2018|p=27}}{{sfn|Grndahl|Asokan|2020a|p=28}} Manual adversarial stylometry can be preferred or even required if the author does not trust available computers with the task (as may be the case for a whistleblower, for example).{{sfn|Wang|Juola|Riddell|2022|p=2}} Software tools require [[software maintenance|maintenance]]; {{harvtxt|Wang|Juola|Riddell|2022}} report that there is no maintained obfuscatory software suitable for general use.{{sfn|Wang|Juola|Riddell|2022|p=3}} {{harvtxt|Zhai|Rusert|Shafiq|Srinivasan|2022}} identify DS-PAN {{harv|Castro-Castro|Ortega Bueno|Muoz|2017}} and Mutant-X {{harv|Mahmood|Ahmad|Shafiq|Srinivasan|2019}} as the 2022 state of the art in automated obfuscation.{{sfn|Zhai|Rusert|Shafiq|Srinivasan|2022|p=7374}} Manual stylistic modulation is a significant effort, with poor [[scalability]] properties; tool assistance can reduce the burden to varying degrees.{{sfn|Grndahl|Asokan|2020a|p=21-22}} Deterministic automated methods can lose effectiveness against a classifier [[adversarial training|trained adversarially]], where output from the style transfer program is used in the classifier's training set.{{sfn|Grndahl|Asokan|2020b|p=176}}

{{harvtxt|Potthast|Hagen|Stein|2016}} give three criteria for use in evaluation of adversarial stylometry methods: ''safety'', meaning that stylistic characteristics are reliably eliminated; ''soundness'', meaning that the semantic content of the text is not unacceptably altered; and ''sensible'', meaning that the output is "well-formed and inconspicuous". Compromising any too deeply is typically an unacceptable result, and the three trade off against each other in practice.{{sfn|Potthast|Hagen|Stein|2016|p=6}} {{harvtxt|Potthast|Hagen|Stein|2016}} find that automatically evaluating sensibility, and specifically whether output is acceptably grammatical and well-formed, is difficult;{{sfn|Potthast|Hagen|Stein|2016|p=12-13}} automated evaluation of soundness is somewhat more promising, but manual review is the best method.{{sfn|Potthast|Hagen|Stein|2016|p=11}}

Despite safety being an important property of an adversarial stylometry method, it can still be usefully traded away if the conceded stylometric identification potential is otherwise possible by non-stylometric analysis&mdash;for example, an author discussing their own upbringing in Britain is unlikely to care if stylometry can reveal that their text is typical of [[British English]].{{sfn|Almishari|Oguz|Tsudik|2014|p=6}}{{sfn|Xu|Qu|Xu|Cui|2019|p=247-248}}

Evaluating the safety of different approaches is complicated by how identification-resistance fundamentally depends on the methods of identification under consideration.{{sfn|Kacmarcik|Gamon|2006|p=448}} The property of being resilient to unknown analyses is called ''transferability''.{{sfn|Haroon|Zaffar|Srinivasan|Shafiq|2021|p=3}} {{harvtxt|Grndahl|Asokan|2020b}} identify four different [[threat model]]s for authors, varying with their knowledge of how their text will be analysed and what [[training data]] will be used: ''query access'', with the weakest analyst and the strongest author who knows both the methods of analysis and the training data; ''architecture access'', where the author knows the analysis methods but not the training data; ''data access'', where the author knows the training data but not the analysis methods; and ''surrogate access'', with the weakest author and the strongest analyst, where the author does not know the methods of analysis nor the training data.{{sfn|Grndahl|Asokan|2020b|p=177}} Further, when an author chooses a method, they must rely on their threat model and trust that it is valid, and that unknown analyses able to detect remaining stylistic signals cannot or will not be performed, or that the masking successfully transfers;{{sfn|Emmery|Kdr|Chrupaa|2021|p=2388-2389}} a stylometrist with knowledge of how the author attempted to mask their style, however, may be able to exploit some weakness in the method and render it unsafe.{{sfn|Potthast|Hagen|Stein|2016|p=9-10}} Much of the research into automated methods has assumed that the author has query access, which may not generalise to other settings.{{sfn|Grndahl|Asokan|2020b|p=189}} Masking methods that internally use an [[ensemble learning|ensemble]] of different analyses as a model for its adversary may transfer better against unseen analyses.{{sfn|Haroon|Zaffar|Srinivasan|Shafiq|2021|p=1}}

Adversarial stylometry

== Evaluation ==

A thorough soundness loss defeats the purpose of communication, though some degree of meaning change may be tolerable if the core message is preserved; requiring only [[textual entailment]] or allowing [[automatic summarisation]] are other options to lose some meaning in a possibly-tolerable way.{{sfn|Potthast|Hagen|Stein|2016|p=11-12}} Rewriting an input text to defeat stylometry, as opposed to consciously removing stylistic characteristics during composition, poses challenges in retaining textual meaning.{{sfn|McDonald|Afroz|Caliskan|Stolerman|2012|loc=7.1 Further Work}} {{harvtxt|Grndahl|Asokan|2020a}} assess the problem of unsoundness as "the most important challenge" for research into fully automatic approaches.{{sfn|Grndahl|Asokan|2020a|p=28}}

For sensibility, if a text is so ungrammatical as to be incomprehensible or so ill-formed that it cannot fit in to its genre then the method has failed, but compromises short of that point may be useful.{{sfn|Potthast|Hagen|Stein|2016|p=12-13}} If inconspicuity is partially lost, then there is the possibility that more expensive and less scalable analyses will be performed (e.g., consulting a forensic linguist) to confirm suspicions or gather further evidence.{{sfn|Potthast|Hagen|Stein|2016|p=13}} The impact of a total inconspicuity failure varies depending on the motivation for performing adversarial stylometry: for someone simply attempting to stay anonymous (e.g., a whistleblower), detection may not be an issue; for a literary forger, however, detection would be disastrous.{{sfn|Potthast|Hagen|Stein|2016|p=5}} Adversarial stylometry can leave evidence of its practice, which is an inconspicuity failure.{{sfn|Mahmood|Shafiq|Srinivasan|2020|p=2235}}{{sfn|Afroz|Brennan|Greenstadt|2012|p=462}} In the Brennan&ndash;Greenstadt corpus, the texts have been found to share a common "style" of their own.{{sfn|Juola|2012|p=93-94}} However, {{harvtxt|Grndahl|Asokan|2020a}} assess existing evidence as insufficient to prove that adversarial stylometry is always detectable, with only limited methods having been studied.{{sfn|Grndahl|Asokan|2020a|p=2}} Improving the smoothness of the output text may reduce the detectability of automated tools.{{sfn|Mahmood|Shafiq|Srinivasan|2020|p=2243}} The overall detectability of adversarial authorship has not been thoroughly studied; if the methods available to be used by the author are unknown to the stylometrist, it may be impossible.{{sfn|Grndahl|Asokan|2020a|p=28}}

The problems of author identification and verification in an adversarial setting are greatly different from recognising nave or cooperative authors.{{sfn|Afroz|Brennan|Greenstadt|2012|p=464}} Deliberate attempts to mask authorship are described by {{harvtxt|Juola|Vescovi|2011}} as a "problem for the current state of stylometric art",{{sfn|Juola|Vescovi|2011|p=123}} and {{harvtxt|Brennan|Afroz|Greenstadt|2012}} state that, despite stylometry's high performance in identifying non-adversarial authors, manual application of adversarial methods render it unreliable.{{sfn|Brennan|Afroz|Greenstadt|2012|p=2}}

{{harvtxt|Kacmarcik|Gamon|2006}} observe that low-dimensional stylometric models which operate on small numbers of features are less resistant to adversarial stylometry.{{sfn|Kacmarcik|Gamon|2006|p=451}} Research has found that authors vary in how well they are able to modulate their style, with some able to successfully perform the task even without training.{{sfn|Wang|Juola|Riddell|2022|p=3}} {{harvtxt|Wang|Juola|Riddell|2022}}, a replication and reproduction of {{harvtxt|Brennan|Afroz|Greenstadt|2012}}, found that all three of imitation, translation and obfuscation meaningfully reduced the effectiveness of authorship attribution, with manual obfuscation being somewhat more effective than manual imitation or translation, which performed similarly to each other; the original study found that imitation was superior.{{sfn|Wang|Juola|Riddell|2022|p=7-8}} {{harvtxt|Potthast|Hagen|Stein|2016}} reported that even simple automated methods of adversarial stylometry caused major difficulties for state-of-the-art authorship identification systems, though at significant soundness and sensibility cost.{{sfn|Potthast|Hagen|Stein|2016|p=21}} Adversarially-aware identification systems can perform much better against adversarial stylometry provided that they know which potential obfuscation methods were used, even if the identifier makes mistakes in analysing which anonymisation method was used.{{sfn|Zhai|Rusert|Shafiq|Srinivasan|2022|p=7373}}

Outline of natural language processing

== Prerequisite technologies ==

The following technologies make natural-language processing possible:

* [[Communication]] &ndash; the activity of a source sending a message to a [[Receiver (information theory)|receiver]]
** [[Language]] &ndash;
*** [[Speech]] &ndash;
*** [[Writing]] &ndash;
** [[Computing]] &ndash;
*** [[Computer]]s &ndash;
*** [[Computer programming]] &ndash;
**** [[Information extraction]] &ndash;
**** [[User interface]] &ndash;
*** [[Software]] &ndash;
**** [[Text editor|Text editing]] &ndash; program used to edit plain [[text file]]s
**** [[Word processor|Word processing]] &ndash; piece of software used for composing, editing, formatting, printing documents
*** [[Input device]]s &ndash; pieces of hardware for sending data to a computer to be processed
**** [[Computer keyboard]] &ndash; typewriter style input device whose input is converted into various data depending on the circumstances
**** [[Image scanner]]s &ndash;

Outline of natural language processing

== Related fields ==

Natural-language processing contributes to, and makes use of (the theories, tools, and methodologies from), the following fields:

* [[Automated reasoning]] &ndash; area of computer science and mathematical logic dedicated to understanding various aspects of reasoning, and producing software which allows computers to reason completely, or nearly completely, automatically. A sub-field of artificial intelligence, automatic reasoning is also grounded in theoretical computer science and philosophy of mind.
* [[Linguistics]] &ndash; scientific study of human language. Natural-language processing requires understanding of the structure and application of language, and therefore it draws heavily from linguistics.
** [[Applied linguistics]] &ndash; interdisciplinary field of study that identifies, investigates, and offers solutions to language-related real-life problems. Some of the academic fields related to applied linguistics are education, linguistics, psychology, computer science, anthropology, and sociology. Some of the subfields of applied linguistics relevant to natural-language processing are:
*** [[Multilingualism|Bilingualism / Multilingualism]] &ndash; 
*** [[Computer-mediated communication]] (CMC) &ndash; any communicative transaction that occurs through the use of two or more networked computers. Research on CMC focuses largely on the social effects of different computer-supported communication technologies. Many recent studies involve Internet-based [[social networking]] supported by [[social software]].
*** [[Contrastive linguistics]] &ndash; practice-oriented linguistic approach that seeks to describe the differences and similarities between a pair of languages.
*** [[Conversation analysis]] (CA) &ndash; approach to the study of social interaction, embracing both verbal and non-verbal conduct, in situations of everyday life. [[Turn-taking]] is one aspect of language use that is studied by CA.
*** [[Discourse analysis]] &ndash; various approaches to analyzing written, vocal, or sign language use or any significant semiotic event.
*** [[Forensic linguistics]] &ndash; application of linguistic knowledge, methods and insights to the forensic context of law, language, crime investigation, trial, and judicial procedure.
*** [[Interlinguistics]] &ndash; study of improving communications between people of different first languages with the use of ethnic and auxiliary languages (lingua franca). For instance by use of intentional international auxiliary languages, such as Esperanto or Interlingua, or spontaneous interlanguages known as pidgin languages.
*** [[Language assessment]] &ndash; assessment of first, second or other language in the school, college, or university context; assessment of language use in the workplace; and assessment of language in the immigration, citizenship, and asylum contexts. The assessment may include analyses of listening, speaking, reading, writing or cultural understanding, with respect to understanding how the language works theoretically and the ability to use the language practically.
*** [[Language pedagogy]] &ndash; science and art of language education, including approaches and methods of language teaching and study. Natural-language processing is used in programs designed to teach language, including first- and second-language training.
*** [[Language planning]] &ndash; 
*** [[Language policy]] &ndash; 
*** [[Lexicography]] &ndash; 
*** [[literacy|Literacies]] &ndash; 
*** [[Pragmatics]] &ndash; 
*** [[Second-language acquisition]] &ndash; 
*** [[stylistics (literature)|Stylistics]] &ndash; 
*** [[Translation]] &ndash;
** [[Computational linguistics]] &ndash; interdisciplinary field dealing with the statistical or rule-based modeling of natural language from a computational perspective. The models and tools of computational linguistics are used extensively in the field of natural-language processing, and vice versa.
*** [[Computational semantics]] &ndash;
*** [[Corpus linguistics]] &ndash; study of language as expressed in samples ''(corpora)'' of "real world" text.  ''Corpora'' is the plural of ''corpus'', and a corpus is a specifically selected collection of texts (or speech segments) composed of natural language. After it is constructed (gathered or composed), a corpus is analyzed with the methods of computational linguistics to infer the meaning and context of its components (words, phrases, and sentences), and the relationships between them.  Optionally, a corpus can be annotated ("tagged") with data (manually or automatically) to make the corpus easier to understand (e.g., [[part-of-speech tagging]]).  This data is then applied to make sense of user input, for example, to make better (automated) guesses of what people are talking about or saying, perhaps to achieve more narrowly focused web searches, or for speech recognition.
** [[Metalinguistics]] &ndash; 
** [[Sign language#Linguistics|Sign linguistics]] &ndash; scientific study and analysis of natural sign languages, their features, their structure (phonology, morphology, syntax, and semantics), their acquisition (as a primary or secondary language), how they develop independently of other languages, their application in communication, their relationships to other languages (including spoken languages), and many other aspects.
* [[Humancomputer interaction]] &ndash; the intersection of computer science and behavioral sciences, this field involves the study, planning, and design of the interaction between people (users) and computers.  Attention to human-machine interaction is important, because poorly designed human-machine interfaces can lead to many unexpected problems. A classic example of this is the [[Three Mile Island accident]] where investigations concluded that the design of the humanmachine interface was at least partially responsible for the disaster.
* [[Information retrieval]] (IR) &ndash; field concerned with storing, searching and retrieving information. It is a separate field within computer science (closer to databases), but IR relies on some NLP methods (for example, stemming). Some current research and applications seek to bridge the gap between IR and NLP.
* [[Knowledge representation]] (KR) &ndash; area of artificial intelligence research aimed at representing knowledge in symbols to facilitate inferencing from those knowledge elements, creating new elements of knowledge. Knowledge Representation research involves analysis of how to reason accurately and effectively and how best to use a set of symbols to represent a set of facts within a knowledge domain.
** [[Semantic network]] &ndash; study of semantic relations between concepts. 
*** [[Semantic Web]] &ndash;
* [[Machine learning]] &ndash; subfield of computer science that examines pattern recognition and computational learning theory in artificial intelligence. There are three broad approaches to machine learning.  [[Supervised learning]] occurs when the machine is given example inputs and outputs by a teacher so that it can learn a rule that maps inputs to outputs. [[Unsupervised learning]] occurs when the machine determines the inputs structure without being provided example inputs or outputs. [[Reinforcement learning]] occurs when a machine must perform a goal without teacher feedback.   
** [[Pattern recognition]] &ndash; branch of [[machine learning]] that examines how machines recognize regularities in data. As with machine learning, teachers can train machines to recognize patterns by providing them with example inputs and outputs (i.e. [[Supervised learning|Supervised Learning]]), or the machines can recognize patterns without being trained on any example inputs or outputs (i.e. [[Unsupervised learning|Unsupervised Learning]]).
** [[Statistical classification]] &ndash;

Outline of natural language processing

== Structures used in natural-language processing ==

* [[Anaphora (linguistics)|Anaphora]] &ndash; type of expression whose reference depends upon another referential element. E.g., in the sentence 'Sally preferred the company of herself', 'herself' is an anaphoric expression in that it is coreferential with 'Sally', the sentence's subject.
* [[Context-free language]] &ndash;
* [[Controlled natural language]] &ndash; a natural language with a restriction introduced on its grammar and vocabulary in order to eliminate ambiguity and complexity
* Corpus &ndash; body of data, optionally tagged (for example, through [[part-of-speech tagging]]), providing real world samples for analysis and comparison.
** [[Text corpus]] &ndash; large and structured set of texts, nowadays usually electronically stored and processed. They are used to do statistical analysis and hypothesis testing, checking occurrences or validating linguistic rules within a specific subject (or ''domain'').
** [[Speech corpus]] &ndash; database of speech audio files and text transcriptions. In Speech technology, speech corpora are used, among other things, to create acoustic models (which can then be used with a speech recognition engine). In Linguistics, spoken corpora are used to do research into phonetic, conversation analysis, dialectology and other fields.
* [[Grammar]] &ndash;
** [[Context-free grammar]] (CFG) &ndash;
** [[Constraint grammar]] (CG) &ndash;
** [[Definite clause grammar]] (DCG) &ndash;
** [[Functional unification grammar]] (FUG) &ndash;
** [[Generalized phrase structure grammar]] (GPSG) &ndash;
** [[Head-driven phrase structure grammar]] (HPSG) &ndash;
** [[Lexical functional grammar]] (LFG) &ndash;
** [[Probabilistic context-free grammar]] (PCFG) &ndash; another name for stochastic context-free grammar.
** [[Stochastic context-free grammar]] (SCFG) &ndash;
** [[Systemic functional grammar]] (SFG) &ndash;
** [[Tree-adjoining grammar]] (TAG) &ndash;
* [[Natural language]] &ndash;
* [[N-gram|''n''-gram]]  sequence of ''n'' number of tokens, where a "token" is a character, syllable, or word. The ''n'' is replaced by a number. Therefore, a 5-gram is an ''n''-gram of 5 letters, syllables, or words. "Eat this" is a 2-gram (also known as a bigram).
** [[Bigram]] &ndash; ''n''-gram of 2 tokens. Every sequence of 2 adjacent elements in a string of tokens is a bigram. Bigrams are used for speech recognition, they can be used to solve cryptograms, and bigram frequency is one approach to statistical language identification.
** [[Trigram]]   special case of the ''n''-gram, where ''n'' is 3.
* [[Ontology (information science)|Ontology]] &ndash; formal representation of a set of concepts within a domain and the relationships between those concepts.
** [[Taxonomy (general)|Taxonomy]] &ndash; practice and science of classification, including the principles underlying classification, and the methods of classifying things or concepts.
*** [[Hyponymy and hypernymy]] &ndash; the linguistics of hyponyms and hypernyms.  A hyponym shares a type-of relationship with its hypernym. For example, pigeon, crow, eagle and seagull are all hyponyms of bird (their hypernym); which, in turn, is a hyponym of animal. 
*** [[Taxonomy for search engines]] &ndash; typically called a "taxonomy of entities". It is a [[tree structure|tree]] in which nodes are labelled with entities which are expected to occur in a web search query. These trees are used to match keywords from a search query with the keywords from relevant answers (or snippets).
* [[Textual entailment]]  directional relation between text fragments. The relation holds whenever the truth of one text fragment follows from another text. In the TE framework, the entailing and entailed texts are termed text (t) and hypothesis (h), respectively. The relation is directional because even if "t entails h", the reverse "h entails t" is much less certain.
* [[Triphone]]  sequence of three phonemes. Triphones are useful in models of natural-language processing where they are used to establish the various contexts in which a phoneme can occur in a particular natural language.

Outline of natural language processing

== Processes of NLP ==

=== Applications ===

* [[Automated essay scoring]] (AES) &ndash; the use of specialized computer programs to assign grades to essays written in an educational setting. It is a method of educational assessment and an application of natural-language processing. Its objective is to classify a large set of textual entities into a small number of discrete categories, corresponding to the possible gradesfor example, the numbers 1 to 6. Therefore, it can be considered a problem of statistical classification.
* [[Automatic image annotation]] &ndash; process by which a computer system automatically assigns textual metadata in the form of captioning or keywords to a digital image. The annotations are used in image retrieval systems to organize and locate images of interest from a database. 
* [[Automatic summarization]] &ndash; process of reducing a text document with a computer program in order to create a summary that retains the most important points of the original document. Often used to provide summaries of text of a known type, such as articles in the financial section of a newspaper.
** Types
*** Keyphrase extraction &ndash;
*** Document summarization &ndash;
**** [[Multi-document summarization]] &ndash;
** Methods and techniques
*** Extraction-based summarization &ndash;
*** Abstraction-based summarization &ndash;
*** Maximum entropy-based summarization &ndash;
*** [[Sentence extraction]] &ndash;
*** Aided summarization &ndash;
**** Human aided machine summarization (HAMS) &ndash;
**** Machine aided human summarization (MAHS) &ndash;
* [[Automatic taxonomy induction]] &ndash; automated construction of [[tree structure]]s from a corpus. This may be applied to building taxonomical classification systems for reading by end users, such as web directories or subject outlines.
* [[Coreference#Coreference resolution|Coreference resolution]] &ndash; in order to derive the correct interpretation of text, or even to estimate the relative importance of various mentioned subjects, pronouns and other referring expressions need to be connected to the right individuals or objects. Given a sentence or larger chunk of text, coreference resolution determines which words ("mentions") refer to which objects ("entities") included in the text.
** [[Anaphora resolution]] &ndash; concerned with matching up pronouns with the nouns or names that they refer to. For example, in a sentence such as "He entered John's house through the front door", "the front door" is a referring expression and the bridging relationship to be identified is the fact that the door being referred to is the front door of John's house (rather than of some other structure that might also be referred to).
* [[Dialog system]] &ndash;
* [[Foreign-language reading aid]] &ndash; computer program that assists a non-native language user to read properly in their target language. The proper reading means that the pronunciation should be correct and stress to different parts of the words should be proper. 
* [[Foreign-language writing aid]] &ndash; computer program or any other instrument that assists a non-native language user (also referred to as a foreign-language learner) in writing decently in their target language. Assistive operations can be classified into two categories: on-the-fly prompts and post-writing checks. 
* [[Grammar checker|Grammar checking]] &ndash; the act of verifying the grammatical correctness of written text, especially if this act is performed by a [[computer program]].
* [[Information retrieval]]  
** [[Cross-language information retrieval]] &ndash; 
* [[Machine translation]] (MT) &ndash; aims to automatically translate text from one human language to another.  This is one of the most difficult problems, and is a member of a class of problems colloquially termed "[[AI-complete]]", i.e. requiring all of the different types of knowledge that humans possess (grammar, semantics, facts about the real world, etc.) in order to solve properly.
** Classical approach of machine translation &ndash; rules-based machine translation.
** [[Computer-assisted translation]] &ndash;
*** [[Interactive machine translation]] &ndash;
*** [[Translation memory]] &ndash; database that stores so-called "segments", which can be sentences, paragraphs or sentence-like units (headings, titles or elements in a list) that have previously been translated, in order to aid human translators.
** [[Example-based machine translation]] &ndash;
** [[Rule-based machine translation]] &ndash;
* [[Natural-language programming]] &ndash; interpreting and compiling instructions communicated in natural language into computer instructions (machine code).
* [[Natural-language user interface|Natural-language search]] &ndash;
* [[Optical character recognition]] (OCR) &ndash; given an image representing printed text, determine the corresponding text.
* [[Question answering]] &ndash; given a human-language question, determine its answer.  Typical questions have a specific right answer (such as "What is the capital of Canada?"), but sometimes open-ended questions are also considered (such as "What is the meaning of life?").
** [[Open domain question answering]] &ndash;
* [[Naive Bayes spam filtering|Spam filtering]] &ndash;
* [[Sentiment analysis]] &ndash; extracts subjective information usually from a set of documents, often using online reviews to determine "polarity" about specific objects. It is especially useful for identifying trends of public opinion in the social media, for the purpose of marketing.
* [[Speech recognition]] &ndash; given a sound clip of a person or people speaking, determine the textual representation of the speech.  This is the opposite of [[text to speech]] and is one of the extremely difficult problems colloquially termed "[[AI-complete]]" (see above).  In [[natural speech]] there are hardly any pauses between successive words, and thus [[speech segmentation]] is a necessary subtask of speech recognition (see below). In most spoken languages, the sounds representing successive letters blend into each other in a process termed [[coarticulation]], so the conversion of the analog signal to discrete characters can be a very difficult process.
* [[Speech synthesis]] (Text-to-speech) &ndash;
* [[Text-proofing]] &ndash;
* [[Text simplification]] &ndash; automated editing a document to include fewer words, or use easier words, while retaining its underlying meaning and information.

Outline of natural language processing

== Processes of NLP ==

=== Component processes ===

==== Component processes of natural-language understanding ====

* [[Automatic document classification]] (text categorization) &ndash;
** [[Automatic language identification]] &ndash;
* [[Compound term processing]] &ndash; category of techniques that identify compound terms and match them to their definitions. Compound terms are built by combining two (or more) simple terms, for example "triple" is a single word term but "triple heart bypass" is a compound term.
* [[Automatic taxonomy induction]] &ndash;
* Corpus processing &ndash;
** [[Automatic acquisition of lexicon]] &ndash;
** [[Text normalization]] &ndash;
** [[Text simplification]]  
* [[Deep linguistic processing]] &ndash;
* [[Discourse analysis]] &ndash; includes a number of related tasks.  One task is identifying the [[discourse]] structure of connected text, i.e. the nature of the discourse relationships between sentences (e.g. elaboration, explanation, contrast).  Another possible task is recognizing and classifying the [[speech act]]s in a chunk of text (e.g. yesno questions, content questions, statements, assertions, orders, suggestions, etc.).
* [[Information extraction]] &ndash;
** [[Text mining]] &ndash; process of deriving high-quality information from text. High-quality information is typically derived through the devising of patterns and trends through means such as statistical pattern learning.
*** [[Biomedical text mining]] &ndash; (also known as BioNLP), this is text mining applied to texts and literature of the biomedical and molecular biology domain. It is a rather recent research field drawing elements from natural-language processing, bioinformatics, medical informatics and computational linguistics. There is an increasing interest in text mining and information extraction strategies applied to the biomedical and molecular biology literature due to the increasing number of electronically available publications stored in databases such as PubMed.
*** [[Decision tree learning]] &ndash;
*** [[Sentence extraction]] &ndash;
** [[Terminology extraction]]  
* [[Latent semantic indexing]] &ndash;
* [[Lemmatisation]] &ndash; groups together all like terms that share a same lemma such that they are classified as a single item. 
* [[Morphology (linguistics)|Morphological segmentation]] &ndash; separates words into individual [[morphemes]] and identifies the class of the morphemes.  The difficulty of this task depends greatly on the complexity of the [[morphology (linguistics)|morphology]] (i.e. the structure of words) of the language being considered.  English has fairly simple morphology, especially [[inflectional morphology]], and thus it is often possible to ignore this task entirely and simply model all possible forms of a word (e.g. "open, opens, opened, opening") as separate words.  In languages such as [[Turkish language|Turkish]], however, such an approach is not possible, as each dictionary entry has thousands of possible word forms.
* [[Named-entity recognition]] (NER) &ndash; given a stream of text, determines which items in the text map to proper names, such as people or places, and what the type of each such name is (e.g. person, location, organization).  Although [[capitalization]] can aid in recognizing named entities in languages such as English, this information cannot aid in determining the type of named entity, and in any case is often inaccurate or insufficient.  For example, the first word of a sentence is also capitalized, and named entities often span several words, only some of which are capitalized.  Furthermore, many other languages in non-Western scripts (e.g. Chinese or [[Arabic language|Arabic]]) do not have any capitalization at all, and even languages with capitalization may not consistently use it to distinguish names.  For example, German capitalizes all [[noun]]s, regardless of whether they refer to names, and French and Spanish do not capitalize names that serve as [[adjective]]s.
* [[Ontology learning]] &ndash; automatic or semi-automatic creation of [[Ontology (information science)|ontologies]], including extracting the corresponding domain's terms and the relationships between those concepts from a corpus of natural-language text, and encoding them with an [[ontology language]] for easy retrieval. Also called "ontology extraction", "ontology generation", and "ontology acquisition".

