== Natural-language processing tools ==

=== Other software ===

* [[CTAKES]] &ndash; open-source natural-language processing system for information extraction from electronic medical record clinical free-text. It processes clinical notes, identifying types of clinical named entitiesdrugs, diseases/disorders, signs/symptoms, anatomical sites and procedures. Each named entity has attributes for the text span, the ontology mapping code, context (family history of, current, unrelated to patient), and negated/not negated. Also known as Apache cTAKES.
* [[Digital Media Access Protocol|DMAP]] &ndash;
* [[ETAP-3]] &ndash; proprietary linguistic processing system focusing on English and Russian. It is a [[Rule-based machine translation|rule-based system]] which uses the [[Meaning-Text Theory]] as its theoretical foundation.
* [[JAPE (linguistics)|JAPE]] &ndash; the Java Annotation Patterns Engine, a component of the open-source General Architecture for Text Engineering (GATE) platform. JAPE is a finite state transducer that operates over annotations based on regular expressions.
* [[LOLITA]] &ndash; "Large-scale, Object-based, Linguistic Interactor, Translator and Analyzer". LOLITA was developed by Roberto Garigliano and colleagues between 1986 and 2000. It was designed as a general-purpose tool for processing unrestricted text that could be the basis of a wide variety of applications. At its core was a semantic network containing some 90,000 interlinked concepts.
* [[Maluuba]] &ndash; intelligent personal assistant for Android devices, that uses a contextual approach to search which takes into account the user's geographic location, contacts, and language.
* [[METAL MT]] &ndash; machine translation system developed in the 1980s at the University of Texas and at Siemens which ran on Lisp Machines.
* [[Never-Ending Language Learning]] &ndash; semantic machine learning system developed by a research team at Carnegie Mellon University, and supported by grants from DARPA, Google, and the NSF, with portions of the system running on a supercomputing cluster provided by Yahoo!. NELL was programmed by its developers to be able to identify a basic set of fundamental semantic relationships between a few hundred predefined categories of data, such as cities, companies, emotions and sports teams. Since the beginning of 2010, the Carnegie Mellon research team has been running NELL around the clock, sifting through hundreds of millions of web pages looking for connections between the information it already knows and what it finds through its search process  to make new connections in a manner that is intended to mimic the way humans learn new information.
* [[NLTK]] &ndash; 
* [[Online-translator.com]] &ndash; 
* [[Regulus Grammar Compiler]] &ndash; software system for compiling unification grammars into grammars for speech recognition systems.
* [[S Voice]] &ndash; 
* [[Siri (software)]] &ndash; 
* [[Speaktoit]] &ndash; 
