'''Natural language processing''' ('''NLP''') is a subfield of [[computer science]] and especially [[artificial intelligence]]. It is primarily concerned with providing computers with the ability to process data encoded in [[natural language]] and is thus closely related to [[information retrieval]], [[knowledge representation]] and [[computational linguistics]], a subfield of [[linguistics]]. Typically data is collected in [[text corpus|text corpora]], using either rule-based, statistical or neural-based approaches in [[machine learning]] and [[deep learning]].

Major tasks in natural language processing are [[speech recognition]], [[text classification]], [[natural-language understanding]], and [[natural language generation|natural-language generation]].
